import { useState } from "react";
import CustomizedAccordions from "../../components/accordion/Accordion";

import "./Duvidas.css";

import { Accordion } from "@mui/material";

interface AjudaSuporteProps {
  expanded: string | false;
  setExpanded: React.Dispatch<React.SetStateAction<string | false>>;
}


const AjudaSuporte: React.FC<AjudaSuporteProps> = ({ expanded, setExpanded }) => {


  return (
    <div className="ajuda-suporte-container">
    <CustomizedAccordions expanded={expanded} setExpanded={setExpanded} />
  </div>
  );
}
export default AjudaSuporte;
